function onFire() {
    this.get('benchmarkResults').textString = ''
    var n = Number(this.get('averageN').textString);
    for(i=0; i<n; i++) {
        this.get('runButton' ).onFire()
    };
    var s = this.get('benchmarkResults').textString
    var sum = Strings.tableize(s).inject(0, 
        function(last, line) {
            return last + Number(line.first().replace("ms", ""))
        })

    var average = sum / n;
    this.get('benchmarkResults').textString =     average +'ms (average ' + n +')\n' + s 

}

